import React from 'react';

const BankCards = ({ playerName, cards }) => {
    return (
        <div>
            <h3>Банк игрока: {playerName}</h3>
            <h4>Карты в банке:</h4>
            <ul>
                {cards.map((card, index) => (
                    <li key={index}>
                        {card.name} ({card.type})
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default BankCards;
